tables.table_schema:
CREATE TABLE customer_feedback (
    id INT PRIMARY KEY,
    customer_name TEXT,
    feedback TEXT,
    rating INT
);

CREATE TABLE product_reviews (
    id INT PRIMARY KEY,
    product_name TEXT,
    review TEXT,
    rating INT
);

CREATE TABLE customer_data (
    customer_id INT PRIMARY KEY,
    customer_name VARCHAR(50),
    email VARCHAR(50),
    phone_number VARCHAR(20)
);
